  if (navigator.appVersion.indexOf("Mac")!= -1){
    console.log(navigator.appVersion.indexOf("Mac"));
    return <Typography />;
  }
  else{
    <TypographyWind />
  }
}

ReactDOM.render(
  <React.StrictMode>

